import React from "react";

const Navlink = () => {
  const links = [
    { name: "Ahşap ayaklı takımlar", submenu : true, sublinks:[
        {
            Head:'topwear',
            sublink:[
                {name:'T-shirt' , link:'/'},
                {name:'T-shirt' , link:'/'},
                {name:'T-shirt' , link:'/'},
                {name:'T-shirt' , link:'/'},
            ]
        }
    ]},
    { name: "Metal ayaklı takımlar"},
    { name: "Yuvarlak / kara masa takımları"},
  ];
  return <div>

    {links.map(item=>(
        <div>
            <div className="PX-3 text-left md:cursor-pointer">
                <h1 className="py-7 ">{item.name}</h1>
                {item.submenu && 
                <div> 
                    <div>
                        <div>
                            {item.sublinks.map((mysublinks)=>[
                                <div>
                                    <h1>{}</h1>
                                </div>
                            ])}
                        </div>
                    </div>
                </div>
                }
            </div>
        </div>
    ))}
  </div>;
};

export default Navlink;
